import { NavLink } from "react-router";

const activate = true;
const styleActive = "active";

const link = [
    {
        href: "/about",
        label: "About",
    },
    {
        href: "/login",
        label: "Login"
    },
    {
        href: "/registration",
        label: "Registration"
    },
    {
        href: "/cabinet",
        label: "Cabinet"
    }
];

export default function MyLinks() {
    return (
        <ul>
            {link.map((item, i) => (
                <li key={i}>
                    <NavLink
                        to={`${item.href}`}
                        className={({isActive}) => {
                            if(activate) 
                                return isActive ? styleActive : "";
                        }}>
                        {`${item.label}`}
                    </NavLink>
                </li>
            ))}
        </ul>
    );
}
